@Component({
  selector: 'app-newjob',
  templateUrl: './newjob.component.html',
  styleUrls: ['./newjob.component.css'],
  standalone: true,
  imports: [AutocompleteFieldsComponent, CommonModule, FormsModule, MatIcon],
})
export class NewjobComponent implements OnInit {
  selectedClient: Client | null = null;
  selectedCar: Car | null = null;
  images: any[] = [
    {
      url: 'data:image/jpeg;base64,',
      alt: 'Toyota Tacoma Front View'
    },
    {
      url: 'data:image/jpeg;base64,',
      alt: 'Toyota Tacoma Side View'
    },
    {
      url: 'data:image/jpeg;base64,',
      alt: 'Toyota Tacoma Interior View'
    },
    {
      url: 'data:image/jpeg;base64,',
      alt: 'Toyota Tacoma Off-Road View'
    },
    {
      url: 'data:image/jpeg;base64,',
      alt: 'Toyota Tacoma Rear View'
    }
  ];

  constructor(private boardServices: BoardService, private jobCardService: JobCardService) { }

  ngOnInit(): void {

  }

  jobRequests: JobRequest[] = []; // Initialize the jobRequests array

  // Add a new job request
  addJobRequest() {
    this.jobRequests.push({
      id: this.generateUniqueId(),
      description: '',
      estimatedCost: 0,
      isChecked: false,
    });
  }
  private generateUniqueId(): string {
    return Math.random().toString(36).substr(2, 9); // Generates a random string
  }
  // Remove a job request by index
  removeJobRequest(index: number) {
    this.jobRequests.splice(index, 1);
  }




  onClientSelected(client: Client) {
    this.selectedClient = client;
  }

  onCarSelected(car: Car) {
    this.selectedCar = car;
  }


  addJobCard() {
    console.log(this.addJobCard)
  }

  submitJobRequests() { }
}